/**
 * This class holds the logical action, i.e:
 * the action name and a value
 */
export default class LogicalAction {
    actionName: string;
    value: any;
    constructor(actionName: string, value: any);
    static fromJSON(lAction: any): LogicalAction;
    toJSON(): {
        actionName: string;
        value: any;
    };
}
